// Basic types

type Position = {
    xPosition: number,
    yPosition: number
};

type Size = {
    height: number,
    width: number
};

type ColorType = {
    color: string
};

type Base64 = {
    img64: string//
};

type Link = {
    link: string// link
};

// Object type

type Block = {
    id: string,
    size: Size,
    position: Position
};

type TextBlock = Block & {
    type: 'text',
    value: string,
    fontSize: number,
    fontFamily: string,
    color: ColorType,
    italic: boolean,
    bold: boolean,
};

type ImageBlock = Block & {
    type: 'image',
    filtr: ColorType,
    data: Base64 | Link| "",
};

type GraphicBlock = Block & {
    type: 'graphic',
    data: string,
    color: ColorType | Base64 | Link| "",
    borderStyle: "solid" | "dotted" | "dashed" | "double",
    borederSize: number,
    borderColor: ColorType | "";
};

type CanvasType = {
    name: string,
    objects: Array<TextBlock | ImageBlock | GraphicBlock>,
    size: Size,
    filtr: ColorType,
    background: ColorType | Base64 | Link
};

type EditorType = {
    canvas: CanvasType,
    selectObject: Array<string>,
    hystory: Hystory,
    template: Array<CanvasType>
};

type Hystory = {

};

export type {
    Position,
    Size,
    ColorType,
    Base64,
    Link,
    Block,
    TextBlock,
    ImageBlock,
    GraphicBlock,
    CanvasType,
    EditorType,
    Hystory
}




